import classes from './Nav.module.css';

const Nav = () => {

    return (
        <ul className={classes.nav}>
            <li>Home</li>
            <li>My To Do List</li>
            <li>Create New Task</li>
            <li>View Task Detail</li>
            <li>Sign Up</li>
        </ul>
    )
};

export default Nav;
